CortanaConsentPanel.Description:
Aby umożliwić Cortanie odpowiadanie na twoje pytania, przypominanie ci o ważnych rzeczach i pomaganie ci w bardziej spersonalizowany sposób, zezwól jej na gromadzenie i wykorzystywanie takich informacji o tobie, jak: 

lokalizacja i historia lokalizacji;

kontakty, dane kalendarza oraz treść i historia komunikacji z wiadomości, czatu i aplikacji;

historia wyszukiwania i inne informacje na urządzeniu.
